import styled from "styled-components";


export const LoginStyled = styled.div`
  display: flex;
  flex-direction: column;
  width: 43%;
  justify-content: space-between;
  background-color: azure;
  border-radius: 7px;
  padding: 35px 20px 25px 20px;
  height: 75%;
`
